import React from 'react';

const recipes = [
  {
    id: 1,
    title: "Chicken Tikka Masala",
  },
  {
    id: 2,
    title: "Palak Paneer",
  },
  {
    id: 3,
    title: "Butter Chicken",
  },
  {
    id: 4,
    title: "Aloo Gobi",
  },
  {
    id: 5,
    title: "Paneer Butter Masala",
  }
];

const RecipeList = () => (
  <div className="recipe-list">
    <ol>
      {recipes.map((recipe) => (
        <li key={recipe.id}>{recipe.title}</li>
      ))}
    </ol>
  </div>
);

export default RecipeList;
